  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer shows lines of equal annual
  change (secular variation) in the vertical component of the total field intensity
  of the Earth's magnetic field, derived from the International Geomagnetic Reference
  Field (IGRF) for the epoch 2010.0. Magnetic intensity is the strength of the magnetic
  field, and is described in terms of a horizontal component and a vertical component.
  The change in intensity is measured in nanoTeslas per year.\",\n\t\"license_title\":
